    .icons .name{
        margin-top: 3px;
        font-size: 14px;
        word-wrap: break-word;
    }

    h2 {
        font-size: 20px;
        margin-bottom: 0;
    }

    .name-type {
        color: #00be53;
    }

    .all-icons-block.active {
        display: flex;
        flex-wrap: wrap;
    }

    .all-icons-block.active h2 {
        display: none;
    }

