<button class="toggle-group-icons" type="button">Group icons</button>

<div class="all-icons-block">
<?php
    foreach ($svg as $svgItem) {
        echo "<h2><span class='name-type'>{$svgItem['type']}</span> - {$svgItem['name']}</h2>";
        echo "<ul class='icons'>";
        foreach ($svgItem["icons"] as $svgItemkey => $svgItemIcon) {

            if ($svgItem['template'] !== "") {
                $svgItemIcon = str_replace("[INNER]", $svgItemIcon, $svgItem['template']);
            }

            if ( $svgItem['type'] === "File SVG" || $svgItem['type'] === "File IMG") {
                $url = __SITE_URL . $svgItemIcon;
                $svgItemIcon = "<img width='auto' height='auto' src='{$url}' style='max-width: 100px; max-height: 40px;'>";
            }

            echo "<li><div class='icon'>{$svgItemIcon}</div> <div class='name'>{$svgItemkey}</div></li>";
        }
        echo "</ul>";
    }
?>
</div>

